description:
From Empire Online:

Every last man and male animal on Earth drops dead. Except for Yorick Brown and his pet monkey. Why have they been spared? What do they do now? And how are they going to survive in a world where half the population is gone and most of the remaining half have gone a little nuts?

The story that results is massive in scope but also intensely personal, taking in gender politics and geophysical realities. In the end it comes down to a small group gathered around a boy and a monkey, with one of the most moving finales weÃ¢â‚¬â„¢ve ever read.

